import { createSlice } from "@reduxjs/toolkit";

const navbarSlice = createSlice({
    name:'navbar-responsive',
    initialState:{
        navbarShow:0
    },
    reducers:{
        navbarReducer:(state) => {
            console.log( state.navbarShow );
        }
    }
});

export const { navbarReducer } = navbarSlice.actions;
export default navbarSlice.reducer;
